local T, C, L, G = unpack(select(2, ...)) -- hide error in center of the screen except for those we added in filter.if not C.error.enable then return endlocal f, o = CreateFrame("Frame"), L.error_noerrorf:SetScript("OnEvent", function(self, event, error)	if C.error.filter[error] then		UIErrorsFrame:AddMessage(error, 1, 0 ,0)	else		o = error	endend)G.Misc.Error = fSLASH_TUKUIERROR1 = "/error"function SlashCmdList.TUKUIERROR() print(o) endUIErrorsFrame:UnregisterEvent("UI_ERROR_MESSAGE")f:RegisterEvent("UI_ERROR_MESSAGE")